import { AppBar, Toolbar } from "@mui/material";
import React from "react";

const styledToolbar = () => {}

const Navbar = () => {
  return (
    <AppBar position="sticky">
      <Toolbar>Navbar</Toolbar>
    </AppBar>
  );
};

export default Navbar;
